  render() {
    const { user } = this.props.auth;
    return (
      <div className="navbar-fixed" style={{backgroundColor: "#231d4e", borderBottom: "2px solid white"}}>
        <div className="col s12 center-align">
            <h4>
              <b>Hello Admin,</b> {user.name.split(" ")[0]}
            </h4>
          </div>
        
       
      </div>
    );
  }
}
export default Navbar;
